import React from 'react';
import Button from 'react-bootstrap/Button';
import { BrowserRouter as Router, Route ,Link} from 'react-router-dom';

const HomePage = () => {

const deneme = () => {
    console.log("tıklama başarılı");
}

return (
 
    <Router>
    <div>
     <Link to="/movies">   <Button variant="secondary" size="lg" onClick={deneme}>SERIES</Button> </Link>
     
        <p> Ppopular Series  </p>
        <Button variant="primary" onClick={deneme}>MOVIES</Button> 
        <p> Popular Movies</p>
        </div>
        </Router>
       
    
);

}

export default HomePage;
